script: |
  super -f text -I q5816.spq | sort > q5816.out

inputs:
  - name: q5816.spq
    data: |
      SELECT 86 FROM tab2 (FORMAT parquet) AS cor0 WHERE + col2 NOT BETWEEN - 75 + - - 26 / + col0 - - 21 * col1 AND - col1 - - 60 * col2;
  - name: tab2

outputs:
  - name: q5816.out
    data: |
      86
      86
      86
